import React from 'react';
import {  
    BrowserRouter as Router,
    Switch,
    Route,
    Link,} from 'react-Router'
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
// import Link from '@material-ui/core/Link'
import Button from '@material-ui/core/Button';
import {topMenuItems} from './menuItems';
import Home from '../pages/home';
import Buy from '../pages/buy';
import Borrow from '../pages/borrow';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    title: {
      width: '4rem',
      padding: theme.spacing(2, 5),
      fontFamily: 'Arial',
      color: 'white',
      fontSize: '15px',
    },
    gap: {
        flexGrow: 5,
    },
    logo: {
        fontFamily: 'Arial',
        color: 'white',
        padding: theme.spacing(2),
        fontSize: '30px',
    },
    appbar: {
        background: 'black',
        minHeight: '5rem',
    }
}));

export default function NavBar() {
    const classes = useStyles();

    return (
      <div className={classes.root}>
        <AppBar position="fixed" className={classes.appbar}>
          <Toolbar>
            <Link to="/" className={classes.logo}>YEAHOO</Link>
            {/* <Link to="/">
                <Button className={classes.logo}>
                    YEAHOO
                </Button>
                <img src={logo} alt="Logo" className={classes.logo} />
              </Link> */}
              {topMenuItems.map(element => {
                  return (
                    <Link to={element.link} key={element.name}>
                      <Button className={classes.title} type="link">
                        {element.name}
                      </Button>
                    </Link>
                  );
                })}
                <Switch>
          <Route path="/public">
            <PublicPage />
          </Route>
          <Route path="/login">
            <LoginPage />
          </Route>
          </Switch>
            <Typography variant="h6" className={classes.gap} />
            <Button color="inherit">Login</Button>
          </Toolbar>
        </AppBar>
      </div>
    );
}
